cs:"<uu5string/>Nastaven oprvnn artefaktu umouje nastavit implicitn a explicitn prva na artefakt. Kad artefakt m profily (prvn sloupec). Piazenm rol a skupin k profilu jim umonte st nebo spravovat dan artefakt. Prvn dka v matici znzoruje skupiny domc jednotky artefaktu. Nastaven implicitnch oprvnn spov v mapovn tchto skupin na profily tohoto artefaktu. Skupinu obsadte do pslunho profilu oznaenm checkboxu ve sloupci pod n. Skupina Authorities mus bt vdy obsazena do profilu Authorities. Podstatou nastaven explicitnho oprvnn je obsazen konkrtn role i skupiny do profilu. Pro explicitn obsazen do profilu slou modr tlatko Pidat roli. Explicitn lze obsadit roli, skupinu, pstupovou roli i skupinu teritoria. Aby bylo mon roli nebo skupinu (mimo pstupovou roli i skupinu teritoria) do profilu artefaktu explicitn obsadit, mus se nachzet ve stejn jednotce jako artefakt. Vce informac naleznete v knize <UU5.Bricks.Link content='uuBusinessTerritory BusinessModel' href='https://uuapp.plus4u.net/uu-bookkit-maing01/e63726a97e3f4fc6b452476eeaf2a025/book/page?code=37055213' target='_blank'/>.",
en:"<uu5string/>Permission settings allow you to set implicit and explicit permissions to the artifact. Each artifact has profiles (first column). Roles and groups have permissions to read or manage the artifact only when they are cast in the relevant profile. The first line in the matrix represents the unit groups of artifact's home unit. The implicit permissions are set by mapping these groups to the artifact's profiles. You can cast a group in the appropriate profile by checking the checkbox in the column below it. The unit group Authorities must always have cast in the profile Authorities. The principle of setting explicit permissions is to cast specific role or group in the profile. To set explicit permissions use a blue button Add a role. You can explicitly cast a role, group, access role, or territory group. Role or group (exept the access role and territory group) can be explicitly cast only if it is in the same unit as the artifact. For more information visit <UU5.Bricks.Link content='uuBusinessTerritory BusinessModel' href='https://uuapp.plus4u.net/uu-bookkit-maing01/e63726a97e3f4fc6b452476eeaf2a025/book/page?code=37055213' target='_blank'/>."
